INSERT INTO sqlab_metadata (name, value) VALUES
  ('activities', '{"0": {"kind": "exercises", "label": "Exercices", "activity_number": 0, "title": "Entraînement", "activity_pitch": "Croyez-le ou non : une simple liste d''entiers, c''est tout ce qu''il faut pour pousser SQL dans ses derniers retranchements.\\n\\nAu programme : tripatouillage de nombres (bien sûr) et de chaînes de caractères, conditions en pagaille, jointures dans tous les sens, sous-requêtes plus ou moins tordues, regroupements des familles, CTE sans tabous, agrégats pas toujours ragoutants… Bref, une plongée vertigineuse dans les profondeurs du langage, dont vous ne ressortirez pas… entier !\\n\\nVous l''avez compris : cette série demande quand même une certaine maîtrise de SQL. Par contre, côté maths, pas de panique : on reste niveau collège — opérateurs arithmétiques, diviseurs, facteurs premiers, rien de foufou.\\n\\nAlors, qu''attendez-vous ? 1, 2, 3, comptez !", "tasks": [{"access": "002", "reward": 10, "number": 1, "task_title": "Carrés parfaits", "columns": ["n"], "formula": "salt_002(sum(nn(hash)) OVER ()) AS token"}, {"access": "052", "reward": 10, "number": 2, "task_title": "Entiers palindromiques", "columns": ["n"], "formula": "salt_052(sum(nn(hash)) OVER ()) AS token"}, {"access": "043", "reward": 10, "number": 3, "task_title": "Nombres triangulaires", "columns": ["n"], "formula": "salt_043((0) + sum(nn(A.hash)) OVER ()) AS token", "tweak_javascript": "result[9]?.n ?? 7_531_148"}, {"access": "010", "reward": 10, "number": 4, "task_title": "Entiers automorphes", "columns": ["n"], "formula": "salt_010(sum(nn(hash)) OVER ()) AS token"}, {"access": "032", "reward": 10, "number": 5, "task_title": "Nombres bicarrés", "columns": ["n"], "formula": "salt_032((0) + sum(nn(A.hash) + nn(B.hash) + nn(C.hash)) OVER ()) AS token", "tweak_javascript": "result[5]?.[''n''] ?? 7_531_148"}, {"access": "033", "reward": 10, "number": 6, "task_title": "Nombres bicarrés", "columns": ["n"], "formula": "salt_033((0) + sum(nn(A.hash) + nn(B.hash)) OVER ()) AS token", "tweak_javascript": "result[5]?.[''n''] ?? 7_531_148"}, {"access": "081", "reward": 10, "number": 7, "task_title": "Nombres premiers", "columns": ["n"], "formula": "salt_081(sum(nn(A.hash)) OVER ()) AS token"}, {"access": "082", "reward": 10, "number": 8, "task_title": "Nombres premiers", "columns": ["n"], "formula": "salt_082(bit_xor(sum(nn(A.hash))) OVER ()) AS token"}, {"access": "062", "reward": 10, "number": 9, "task_title": "Nombres premiers", "columns": ["n", "divisors"], "formula": "salt_062(string_hash(''(0)'') + bit_xor(sum(nn(A.hash))) OVER ()) AS token", "tweak_javascript": "result[13]?.divisors ?? 7_531_148"}, {"access": "023", "reward": 10, "number": 10, "task_title": "Nombres abondants", "columns": ["n"], "formula": "salt_023((0) + bit_xor(sum(nn(A.hash) + nn(B.hash))) OVER ()) AS token", "tweak_javascript": "result[5]?.[''n''] ?? 7_531_148"}, {"access": "024", "reward": 10, "number": 11, "task_title": "Nombres abondants", "columns": ["n"], "formula": "salt_024((0) + sum(nn(A.hash)) OVER ()) AS token", "tweak_javascript": "result[5]?.[''n''] ?? 7_531_148"}, {"access": "037", "reward": 10, "number": 12, "task_title": "Entiers sans facteurs carrés", "columns": ["n"], "formula": "salt_037(sum(nn(hash)) OVER ()) AS token"}, {"access": "009", "reward": 10, "number": 13, "task_title": "Nombres de Kaprekar", "columns": ["n"], "formula": "salt_009(sum(nn(hash)) OVER ()) AS token"}, {"access": "019", "reward": 10, "number": 14, "task_title": "Suite de Fibonacci", "columns": ["n"], "formula": "salt_019(string_hash(''(0)'') + count(*) OVER ()) AS token", "tweak_javascript": "result.map(x => x?.n ?? '''').join(''.'') || ''7_531_148''"}, {"access": "039", "reward": 10, "number": 15, "task_title": "Nombres de Harshad", "columns": ["n"], "formula": "salt_039(sum(string_hash(''(0)'')) OVER ()) AS token", "tweak_javascript": "[result.length].concat(result.slice(0, 20).map(x => x.n)).join(''.'')"}, {"access": "088", "reward": 10, "number": 16, "task_title": "FizzBuzz", "columns": ["fizzbuzz"], "formula": "salt_088(string_hash(''(0)'') + sum(nn(hash)) OVER ()) AS token", "tweak_javascript": "(result.slice(8, 16).map(x => x?.fizzbuzz ?? '''').join(''.'') || '''').toLowerCase() || ''7_531_148''"}, {"access": "078", "reward": 10, "number": 17, "task_title": "Prévalence comparée des vendredis 13", "columns": ["day", "occurrences"], "formula": "salt_078(string_hash(''(0)'') + count(*) OVER ()) AS token", "tweak_javascript": "result.map(x => x?.occurrences ?? '''').join('' '') || ''7_531_148''"}, {"access": "047", "reward": 10, "number": 18, "task_title": "Conversion en chiffres romains", "columns": ["n", "roman"], "formula": "salt_047(sum(string_hash(''(0)'')) OVER ()) AS token", "tweak_javascript": "col.roman.slice(10).filter((_, n) => n % 43 === 0).map(x => x.roman).join(''.'')"}, {"access": "020", "reward": 10, "number": 19, "task_title": "Convoyeur d''entiers", "columns": ["bin", "mini", "maxi", "total"], "formula": "salt_020(bit_xor(string_hash(''(0)'')) OVER ()) AS token", "tweak_javascript": "(result.reduce((sum, x) => sum + Number(x?.mini ?? 0), 0).toString() + result.reduce((sum, x) => sum + Number(x?.maxi ?? 0), 0).toString() + result.reduce((sum, x) => sum + Number(x?.total ?? 0), 0).toString()) || ''7_531_148''"}], "task_count": 19, "hint_count": 42, "toc": "[{\\"title\\": \\"Suites numériques\\", \\"intro\\": \\"Filtrez une liste d''entiers pour la réduire aux premiers termes de suites bien connues.\\", \\"taskGroups\\": [{\\"groupTitle\\": \\"Carrés parfaits\\", \\"tasks\\": [1]}, {\\"groupTitle\\": \\"Entiers palindromiques\\", \\"tasks\\": [2]}, {\\"groupTitle\\": \\"Nombres triangulaires\\", \\"tasks\\": [3]}, {\\"groupTitle\\": \\"Entiers automorphes\\", \\"tasks\\": [4]}, {\\"groupTitle\\": \\"Nombres bicarrés\\", \\"tasks\\": [5, 6]}, {\\"groupTitle\\": \\"Nombres premiers\\", \\"tasks\\": [7, 8, 9]}, {\\"groupTitle\\": \\"Nombres abondants\\", \\"tasks\\": [10, 11]}, {\\"groupTitle\\": \\"Entiers sans facteurs carrés\\", \\"tasks\\": [12]}, {\\"groupTitle\\": \\"Nombres de Kaprekar\\", \\"tasks\\": [13]}, {\\"groupTitle\\": \\"Suite de Fibonacci\\", \\"tasks\\": [14]}, {\\"groupTitle\\": \\"Nombres de Harshad\\", \\"tasks\\": [15]}]}, {\\"title\\": \\"Mélanges\\", \\"intro\\": \\"Utilisez une liste d''entiers comme support de création de tables intéressantes ou amusantes.\\", \\"taskGroups\\": [{\\"groupTitle\\": \\"FizzBuzz\\", \\"tasks\\": [16]}, {\\"groupTitle\\": \\"Prévalence comparée des vendredis 13\\", \\"tasks\\": [17]}, {\\"groupTitle\\": \\"Conversion en chiffres romains\\", \\"tasks\\": [18]}, {\\"groupTitle\\": \\"Convoyeur d''entiers\\", \\"tasks\\": [19]}]}]"}}'),
